import React from 'react';

function Home(){
    return(
        <div style={{marginTop: "100px"}}>
            <p>I am normal</p>
            <p style="color:red;">I am red</p>
            <p style="color:blue;">I am blue</p>
            <p style="font-size:50px;">I am big</p>
        </div>

    )
}

export default Home;
